	// Nested procedure calls could be in ALL procedures,
	//not just in phase 1 procedures
	public static String getEntityName(final String mine) {
		for (final Iterator<String> iterator = UserProcedures.allProc.iterator(); iterator
				.hasNext();) {
			String type = iterator.next();
			type = type.substring(type.indexOf(".") + 1); // Nested procedure calls do not have schema names within them
			if (mine.contains(type + "("))
				return type;
		}
		return "NA";
	}

	private static void getMatchingInformaticaProcedures(final HashSet<String> informatica_proc,
			final HashSet<String> localPhaseProc) {
		final HashSet<String> finalMatch = new HashSet<String>();
		final CopyOnWriteArraySet<String> notAMatch = new CopyOnWriteArraySet<String>(informatica_proc);

		for (final Iterator<String> iterator = localPhaseProc.iterator(); iterator.hasNext();) {
			final String source = iterator.next();
			for (final Iterator<String> iterator2 = informatica_proc.iterator(); iterator2
					.hasNext();) {
				final String target = iterator2.next();
				if (source.equalsIgnoreCase(target) || source.substring(source.indexOf(".") + 1 , source.length()).equalsIgnoreCase(target)){
					finalMatch.add(source);
					notAMatch.remove(target);
				}
			}
		}
		System.out.println("Source Size: " + localPhaseProc.size());
		System.out.println("Iteration 1 procedures identified in Phase 1: " + informatica_proc.size());
		System.out.println("Iteration 1 procedures not identified in Phase 1: " + notAMatch.size());
		System.out.println(finalMatch.size());
		System.out.println(finalMatch.toString());
		System.out.println(notAMatch.toString());
	}
